function Filter({ filterData }) {
    return(
        <div className='flex gap-4 justify-center text-white my-2'>
            {filterData.map((data) => (
                <button onClick={filterHandler()} key={data.id} type="button" className="bg-indigo-900 py-1 px-3 text-xl rounded-md border-white hover:border-2 hover:bg-indigo-600 duration-300">{data.title}</button>
            ))}
        </div> 
    )
}
export default Filter;
